/**
=========================================================
* Material Dashboard 2 React - v2.2.0
=========================================================

* Product Page: https://www.creative-tim.com/product/material-dashboard-react
* Copyright 2023 Creative Tim (https://www.creative-tim.com)

Coded by www.creative-tim.com

 =========================================================

* The above copyright notice and this permission notice shall be included in all copies or substantial portions of the Software.
*/

// @mui material components
import Grid from "@mui/material/Grid";
import Card from "@mui/material/Card";
import Box from '@mui/material/Box';
// Material Dashboard 2 React components
import MDBox from "components/MDBox";
import MDTypography from "components/MDTypography";

// Material Dashboard 2 React example components
import DashboardLayout from "examples/LayoutContainers/DashboardLayout";
import DashboardNavbar from "examples/Navbars/DashboardNavbar";
import Footer from "examples/Footer";
import {useState} from 'react';
import DataTable from "examples/Tables/DataTable";

// Data
import MDButton from "components/MDButton";
//modal
import Dialog from '@mui/material/Dialog';
import DialogActions from '@mui/material/DialogActions';
import DialogContent from '@mui/material/DialogContent';
import DialogContentText from '@mui/material/DialogContentText';
import DialogTitle from '@mui/material/DialogTitle';
import TextField from '@mui/material/TextField';
import { Autocomplete } from "@mui/material";
import { styled } from '@mui/material/styles';
import Paper from '@mui/material/Paper';
import DRData from "layouts/DetailedResults/DetailedResultsData";
function DetailedResultData() {
  const Item = styled(Paper)(({ theme }) => ({
    backgroundColor: theme.palette.mode === 'dark' ? '#1A2027' : '#fff',
    ...theme.typography.body2,
    padding: theme.spacing(1),
    textAlign: 'center',
    color: theme.palette.text.secondary,
  }));
  const styles = {
    gridContainer: {
      border: 'none', // Hide borders
    },
  };
  const { columns, rows } = DRData();
  const [open, setOpen] = useState(false);

  const handleOpen = () => {
    setOpen(true);
  };

  const handleClose = () => {
    setOpen(false);
  };
  const Department=[
    {label:"Computer science and engineering",value:"cse"},
    {label:"Information Technology",value:"IT"},
    {label:"Artificial Intelligence and Machine Learning",value:"AIML"},
    {label:"Artificial Intelligence and Data Science",value:"AIDS"},
    {label:"Civil engineering",value:"Civil"},
    {label:"Electronics communications and Engineering",value:"ECE"},
    {label:"Electronical and Electronics Engineering",value:"EEE"},
    {label:"Mechanical Engineering",value:"MECH"},
    {label:"Computer Science and Buisness Systems",value:"CSBS"},
    {label:"Master of Buisness Administration",value:"MBA"},
    {label:"Master of Computer Administration",value:"MCA"}
  ];
  const Year=[
    {label:"I",value:"I"},
    {label:"II",value:"II"},
    {label:"III",value:"III"},
    {label:"IV",value:"IV"}
  ]
  return (
    <DashboardLayout>
      <MDBox pt={6} pb={3}>
        <Grid container spacing={6}>
          <Grid item xs={12}>
            <Card>
              <MDBox
                mx={2}
                mt={-3}
                py={3}
                px={2}
                variant="gradient"
                bgColor="info"
                borderRadius="lg"
                coloredShadow="info"
                display="flex"
                justifyContent="space-between" // To space elements evenly
                alignItems="center" // Align items vertically
              >
                <MDTypography variant="h6" color="white">
                  Detailed Results
                </MDTypography>
              </MDBox>
              <Grid container rowSpacing={1} columnSpacing={{ xs: 1, sm: 2, md: 3 }}  sx={styles.gridContainer} >
                <Grid item xs={6} sx={styles.gridContainer}>
                  <Item>
                    <MDTypography color="dark">
                      Zoho Test
                    </MDTypography>
                  </Item>
                </Grid>
                <Grid item xs={6}>
                  <Item>2</Item>
                </Grid>
                <Grid item xs={6}>
                  <Item>3</Item>
                </Grid>
                <Grid item xs={6}>
                  <Item>4</Item>
                </Grid>
              </Grid>
              <MDBox pt={3}>
                <DataTable
                  table={{ columns, rows }}
                  isSorted={false}
                  entriesPerPage={false}
                  showTotalEntries={false}
                  noEndBorder
                />
              </MDBox>
            </Card>

          </Grid>
        </Grid>
      </MDBox>
      <Footer />
    </DashboardLayout>
  );
}

export default DetailedResultData;
